// SPDX-License-Identifier: MIT
pragma solidity 0.8.15;
pragma abicoder v2;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./SafeToken.sol";


contract SafeMinter is Ownable {
    SafeToken public token;
    
    constructor(uint _maxSupplyTransferPercentage, uint _totalSupply, uint _epochDelay) {
        token = new SafeToken(address(this), _maxSupplyTransferPercentage, _totalSupply, _epochDelay);
    }

    function mint() external payable {
        require(msg.value > 0 && token.balanceOf(address(this)) >= msg.value, "Send another token amount");

        uint mintAmount = msg.value * 10;
        token.transfer(msg.sender, mintAmount);

        (bool isSent, ) = address(owner()).call{ value: msg.value }("");
        require(isSent);
    }

}
